import { Link } from "react-router-dom";
function MainNavigation() {
  return (
    <head>
      <div>React Meetups</div>
      <ul>
        <li>
            <Link to='/'>All Meetups</Link>
        </li>
      </ul>
      <li>
            <Link to='/favorite'>Favorite Meetups</Link>
        </li>
        <li>
            <Link to='/new'> New Meetup</Link>
        </li>
    </head>
  );
}
export default MainNavigation;
